import React from 'react';
import Navbar from './components/NavBar';
import { BrowserRouter, Route, Link } from 'react-router-dom';

function App() {
  return (
    <div className="App">
      <Navbar />
      <BrowserRouter>

        <Route path='/home' Component={Homescreen} />

      </BrowserRouter>
    </div>
  );
}

export default App;
